import React from "react";
import Header from "./Header";
import Store from "./Store/Store";
import Footer from "./Footer"
const MainHome = () => {
  return (
    <>
      <Header/>
      <Store/>
      <CartDisplay/>
      <Footer/>
      
    </>
  );
};

export default MainHome;
